import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  display: flex;
  align-items: center;
  flex-direction: column;
  font-family: "Roboto";
  width: 100%;
`;

const Header = styled.h2`
  display: flex;
  span {
    color: red;
  }
`;

const GameTypes = () => {
  return (
    <Wrapper>
      <Header>
        Welcome in <span> Online Gaming </span>
      </Header>
    </Wrapper>
  );
};

export default GameTypes;
